script: |
  super -f text -I q9516.spq | sort > q9516.out

inputs:
  - name: q9516.spq
    data: |
      SELECT - - col2 / col0 + + - col2 + - + col2 AS col2 FROM tab1 (FORMAT parquet) AS cor0 WHERE col0 * col2 * 96 IS NOT NULL;
  - name: tab1

outputs:
  - name: q9516.out
    data: |
      -118
      -136
      -191
